import React,{useState} from 'react';
import classes from './resetPassword.module.scss';

const ResetPassword = ({match})=>{

    const {userId, token} = match.params;
    const {newPassword, setNewPassword} = useState('');
    const {confirmPassword, setConfirmPassword} = useState('');

    const onFormSubmit = (e)=>{
        e.preventDefault();
    }
    return (
        <div className={classes.overlay}>
            <form className={classes.content} onSubmit={onFormSubmit}>
                <div className={classes.inputGroup}>
                    <label>NewPassword:</label>
                    <input className={classes.passwordField} type='password' required />
                </div>
                <div className={classes.inputGroup}>
                    <label>Confirm password:</label>
                    <input className={classes.confirmPasswordField} type='password' required />
                </div>
                <div className={classes.submitBtn}>
                    <button type='submit' />
                </div>
            </form>
        </div>
    );
}

export default ResetPassword;
